  [],\n\t\"num_tags\": 0,\n\t\"name\": \"temperature-profiles-from-expendable-bathythermograph-xbt-casts-from-the-noaa-ship-oceanographe4255e\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"XBT data were collected from NOAA Ship
  OCEANOGRAPHER in support of the Integrated Global Ocean Services System (IGOSS)
  project. Data were collected by the National Environmental Satellite Data and Information
  Service (NESDIS) from 02 September 1979 to 05 September 1979. Data were processed
  by NODC to the NODC standard Universal Bathythermograph Output (UBT) format. Full
  format description is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/bt.html.nnThe
  UBT file format is used for temperature-depth profile data obtained using expendable
  bathythermograph (XBT) instruments. Standard XBTs can obtain profiles at depths
  of about 450 or 760 m. With special instruments, measurements can be obtained to
  1830 m. Cruise information, position, date, and time are reported for each observation.
  The data record comprises pairs of temperature-depth values. Unlike the MBT data
  file, in which temperature values are recorded at uniform 5m intervals, the XBT
  Data File contains temperature values at non-uniform depths. These depths are at
  a minimum number of points (\"inflection points\") required to record the temperature
  curve to an acceptable degree of accuracy. On output, however, the user may request
  temperature values either at inflection points or interpolated to uniform depth
  increments.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
